{"source":{"uri":"features/specs/login.feature","data":"#language: pt\n\n@login\nFuncionalidade: Login\n    SENDO um cliente do BugBank\n    QUERO poder logar\n    PARA poder acessar as funcionalidades de usuário logado\n\n    Contexto: Estar na página inicial\n        Dado que esteja na página incial\n\n    @valid_login\n    Cenário: Login válido\n        Quando realizar o login com usuário válido\n        Então devo ser logado com sucesso\n\n    @invalid_login\n    Esquema do Cenário: Login convencional inválido\n        Quando realiza o login com usuário \"<usuario>\" e senha \"<senha>\"\n        Então abre um popup com a mensagem \"<mensagem>\" para login inválido\n        Exemplos:\n        |usuario          |senha            |mensagem                                                                |\n        |valid_user_data  |invalid_user_data|Usuário ou senha inválido.Tente novamente ou verifique suas informações!|\n        |invalid_user_data|valid_user_data  |Usuário ou senha inválido.Tente novamente ou verifique suas informações!|\n\n    @empty_login\n    Cenário: Login com campos vazios\n        Quando deixa o login com usuário e senha vazios\n        Então exibe a mensagem para campo obrigatório\n\n    @redirect_to_register\n    Cenário: Redirecionamento para página de cadastro\n        Quando acessa a funcionalidade para criação de nova conta\n        Então é redirecionado para página de cadastro\n\n    @logout\n    Cenário: Logout\n        E está logado no sistema\n        Quando aperta o botão de sair\n        Então volta para home como usuário não logado no sistema","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/registro.feature","data":"#language: pt\n\n@registro\nFuncionalidade: Registro\n  Sendo um possivel cliente do BugBank\n  Quero poder me registrar\n  Para que eu possa acessar funcionalidades de usuário registrado\n\n    Contexto: Estar na página inicial\n        Dado que esteja na página incial\n\n    @valid_register\n    Cenário: Registro bem-sucedido sem saldo\n        Dado que eu estou na página de registro\n        Quando eu insiro um email válido\n        E insiro um nome válido\n        E insiro uma senha válida\n        E insiro uma senha igual a anterior\n        E escolho a opção \"Não\" para conta com saldo\n        E clico no botão \"Registrar\"\n        E devo ver uma mensagem de sucesso \"Registro concluído com sucesso!\"\n        Então devo ser redirecionado para a página de login\n\n    @valid_register_saldo\n    Cenário: Registro bem-sucedido com saldo\n        Dado que eu estou na página de registro\n        Quando eu insiro um email válido\n        E insiro um nome válido\n        E insiro uma senha válida\n        E insiro uma senha igual a anterior\n        E escolho a opção \"Sim\" para conta com saldo\n        E clico no botão \"Registrar\"\n        E devo ver uma mensagem de sucesso \"Registro concluído com sucesso e sua conta possui saldo!\"\n        Então devo ser redirecionado para a página da conta","mediaType":"text/x.cucumber.gherkin+plain"}},
